import "./style.css";

export default function EachItem() {
  return (
    <div className="eachItem🍷">
      <img src="https://www.thecocktaildb.com/images/media/drink/vrwquq1478252802.jpg/preview" alt="*" className="img" />
      <div className="context">
        <div className="title">HelloWorld</div>
        <div className="title">Id: h3945</div>
      </div>
    </div>
  );
}
